<section id=""Instrucoes"" class=""classHidden"">
    <div id=""div-container"">
        <div>
            <h2 style=""margin-bottom: 16px"">Instruções:</h2>
            <div style=""margin-left: 20px"">
                <p style=""color: black; font-size: 1.3em"">
                    <strong>LOAD: </strong>
                    É a busca do dado em um endereço que será carregado para o
                    registrador.
                </p>
                <p style=""color: black; font-size: 1.3em"">
                    <strong> STO: </strong>
                    É o armazenamento do dado que está no registrador para a memória
                </p>

                <p style=""color: black; font-size: 1.3em""");
            WriteLiteral(@">
                    Na instrução LOAD, podemos pegar valores armazenados na memória, e
                    inseri-los nos registradores, respeitando a ordem onde primeiro
                    deve vir a instrução, em seguida o endereço da memória onde contém
                    o valor e só em seguida o registrador onde será armazenado.
                </p>
                <p style=""color: black; font-size: 1.1em"">
                    <strong> Ex: LOAD 2 R1 </strong>
                </p>
                <p style=""color: black; font-size: 1.3em"">
                    Já a instrução STO, acontece o contrário da instrução LOAD, pois
                    agora pegaremos os valores no registrador e colocaremos no
                    endereço, respeitando também a hierarquia onde primeiro vem
                    instrução, em seguida o endereço e só após o registrador
                </p>
                <p style=""color: black; font-size: 1.1em"">
                    <strong>Ex: STO 2 R4 </strong>
  ");
            WriteLiteral(@"              </p>
            </div>
            <h2 style=""margin-bottom: 16px"">Operandos:</h2>

            <div style=""margin-left: 20px"">
                <p style=""color: black; font-size: 1.3em"">
                    <strong> ADD: </strong>
                    Soma os valores armazenados nos registradores
                </p>
                <p style=""color: black; font-size: 1.3em"">
                    <strong>SUB: </strong>
                    Subtrai os valores armazenados nos registradores
                </p>
                <p style=""color: black; font-size: 1.3em"">
                    <strong> MULT: </strong>
                    Multiplica os valores armazenados nos registradores
                </p>
                <p style=""color: black; font-size: 1.3em"">
                    <strong> DIV:</strong>
                    Divide os valores armazenados nos registradores
                </p>

                <p style=""color: black; font-size: 1.3em"">
                    Dentro d");
            WriteLiteral(@"os operandos (ADD, SUB. MULT e DIV), funcionará sempre da
                    mesma forma, o primeiro e o segundo registrador (Rx e Rx,
                    respectivamente, podendo ser o primeiro ao quarto registrador)
                    receberão os valores a serem processados. Após a conclusão deste
                    processo, o terceiro registrador (Rx) receberá o resultado da
                    operação entre Rx e Rx.
                </p>
                <p style=""color: black; font-size: 1.1em"">
                    <strong> Ex: MULT R1 R3 R4 </strong>
                </p>

